import teste from '../../assets/images/my-logo.png';

export default function ProjectCard() {
  return (
    <div className="card">
      <div className="content">
        <img src={ teste } alt="testando" />
        <h1>01</h1>
        <h3>cart one</h3>
        <p>Qualquer coisa escrita no cart, sera uma
          descricao depois
        </p>
      </div>
    </div>
  )
}
